INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (321, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 1, 0, 2, 1, "リリ", 24001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (322, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 2, 0, 2, 1, "クリア", 24001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (323, 1, "んーと。\nこれ、あげる。\nはい", 126101, 3, 0, 2, 1, "プレシア", 24001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (324, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 4, 0, 2, 1, "リリ", 24001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (325, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 5, 0, 2, 1, "クリア", 24001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (326, 2, "お兄。\nきてくれて、うれしい", 126101, 6, 0, 2, 1, "プレシア", 24001, 40011);
